import React from 'react'
import './styles/scroll-icon.css'

class ScrollIcon extends React.Component {
    render () {
        return (
            <React.Fragment>
                <div className='mouse'></div>
                <p className='scroll-p'>Scroll</p>
            </React.Fragment>
        )
    }
}

export default ScrollIcon;
